import axios from 'axios';

const API = axios.create({
  baseURL: 'http://localhost:5000/api/interview',
});

export const ask = (question) => API.post('/ask', { question });
export const evaluate = (question, answer) => API.post('/evaluate', { question, answer });
export const feedback = (answers) => API.post('/feedback', { answers });
